webpackJsonp([0xc76fabb5c70e],{1280:function(o,t){o.exports={data:{site:{siteMetadata:{title:"Nobody Listens Anyway",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2008-08-28-open-any-document-in-google-docs-via-a-url/index.md absPath of file >>> MarkdownRemark",html:'<p>We are looking at ways to integrate the new Teachers Without Borders site with Google docs.</p>\n<p>Turns out that you can open:\ndocuments - .pdf, .doc, .txt, .html, .rtf and .odt\nspreadsheets - .xls, .csv, .ods\npresentations - .ppt</p>\n<p>By feeding the file url to this google url:</p>\n<blockquote>\n  http://docs.google.com/?DocAction=updoc&formsubmitted=true&uploadURL=DOCUMENT_URL\n</blockquote>\n<p>Here\'s an example if you needed to view a W4 form from the IRS url:</p>\n<blockquote>\n  http://www.irs.gov/pub/irs-pdf/fw4.pdf\n</blockquote>\n<p>Use this url:</p>\n<p><a href="http://docs.google.com/?DocAction=updoc&formsubmitted=true&uploadURL=http://www.irs.gov/pub/irs-pdf/fw4.pdf">http://docs.google.com/?DocAction=updoc&#x26;formsubmitted=true&#x26;uploadURL=http://www.irs.gov/pub/irs-pdf/fw4.pdf</a></p>',frontmatter:{title:"Open Any Document in Google Docs Via a Url",date:"August 28, 2008",image:null}}},pathContext:{path:"/open-any-document-in-google-docs-via-a-url"}}}});
